import React from 'react';

interface HeaderProps {
  title: string;
  links: { name: string; href: string }[];
}

const Header: React.FC<HeaderProps> = ({ title, links }) => {
  return (
    <header style={{
        width: '100%',
        padding: '28px 0 18px 0',
        background: 'linear-gradient(90deg, #22223b 0%, #4a4e69 50%, #9a8c98 100%)',
        color: '#fff',
        marginBottom: 32,
        boxShadow: '0 2px 12px rgba(34,34,59,0.10)',
        position: 'fixed',
        top: 0,
        left: 0,
        zIndex: 1000
    }}>
        <div style={{ maxWidth: 1100, margin: '0 auto', display: 'flex', alignItems: 'center', justifyContent: 'space-between', flexWrap: 'wrap', gap: 16 }}>
            <span style={{ fontSize: '2rem', fontWeight: 700, letterSpacing: 1 }}>{title}</span>
            <nav>
                <ul>
                    {links.map(link => (
                        <li key={link.name}>
                            <a href={link.href} style={{
                                color: '#fff',
                                textDecoration: 'none',
                                marginLeft: 32,
                                fontWeight: 500,
                                fontSize: '1.1rem',
                                letterSpacing: 0.5,
                                transition: 'color 0.2s',
                            }}
                            onMouseOver={e => (e.currentTarget.style.color = '#c9ada7')}
                            onMouseOut={e => (e.currentTarget.style.color = '#fff')}
                            >
                                {link.name}
                            </a>
                        </li>
                    ))}
                </ul>
            </nav>
        </div>
    </header>
  );
};

export default Header;
